// SPDX-License-Identifier: MIT
pragma experimental ABIEncoderV2;
pragma solidity ^0.6.0;
//0xB5dea2661dfa4b8f0aaE8Bc1F583369D927c3b06
contract TestProposal {
    struct Proposal{
        uint proposalId;
        uint proposalStatus;
        address proposalCreator;
        uint proposalNumOfOptions;
        // mapping (uint => Voter) voters;
        // mapping (uint => proposalOption) options;
    }

    struct Member{
        uint id;
        string name;
        bool isVoted;
    }

    mapping (uint => Proposal) public proposals;
    event savingEvent(uint indexed _proposalId);
    uint public proposalCount;

    constructor() public {
        proposalCount = 0;
        addProposal(1, 1, 0xB5dea2661dfa4b8f0aaE8Bc1F583369D927c3b06, 3);
    }

    function addProposal(uint _proposalId, uint _proposalStatus, address _proposalCreator, uint _proposalNumOfOptions) public {
        proposals[proposalCount] = Proposal(_proposalId, _proposalStatus, _proposalCreator, _proposalNumOfOptions);
        proposalCount++;
    }

    // function getMemberStructure(uint _memberId) public view returns(Member memory){
    //     return members[_memberId];
    // }

}
